import $ from 'jquery';
import React from 'react';
import {
  BarChart, Bar, Brush, ReferenceLine, XAxis, YAxis,
  CartesianGrid, Tooltip, Legend,
} from 'recharts';

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      sums: [],
    };
    this.serverRequest = this.serverRequest.bind(this);
  }
  serverRequest(){
    $.get("http://localhost:5000/api/logs/sums", res => {
      console.log(res);
      this.setState({
        sums: res
      });
    });
  }
  componentDidMount(){
    this.serverRequest();
  }
  render() {
    return (
      <div>
        <h1>Hello, Soya</h1>
        <Chart datas={this.state.sums}/>
        <RenderPrice datas={this.state.sums}/>
      </div>
    )
  }
}
function Chart(props) {
  return (
      <BarChart
        width={500}
        height={300}
        data={props.datas}
        stackOffset="sign"
        margin={{
          top: 5, right: 30, left: 20, bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="date" />
        <YAxis />
        <Tooltip />
        <Legend verticalAlign="price" height={30} stroke="#8884d8" />
        <ReferenceLine y={0} stroke="#000" />
        <Brush dataKey="date" height={30} stroke="#8884d8" />
        <Bar dataKey="price" stackId="a" fill="#82ca9d" />
        <Bar dataKey="diff" stackId="a" fill="#8884d8" />
        <Bar dataKey="total" fill="#ffc658" />
      </BarChart>
  )
}
function RenderPrice(props) {
  console.log(props.datas);
  return (
    <div>
    {props.datas.map((data, id, arr) => (
      <h2>{id}</h2>
    ))}
    </div>
  )
}
export default Home;
